import { Component } from "react";

class Nuevos extends Component{
    render(){
        return(
            <div>
                <h2>Nuevos</h2>
                <form>
                    Tipo:
                    <select>
                        <option>Ingreso</option>
                        <option>Egreso</option>
                    </select>
                    concepto: <input></input>
                    concepto: <input></input>
                    categoria:
                    <button onClick="">Cargar</button>
                </form>
            </div>
        )
    }
}

export default Nuevos;
